export const Tweets = () => {
    const dispatch = useDispatch();
     useEffect(() => {
    const fetchData = async () => {
      await dispatch(fetchUsers());
    };

         fetchData();
         console.log(fetchData())
  }, [dispatch]);
    return (
        <Header />
        
    )
}
